brands.description:
ICA – лакофарбові матеріали для дерев’яних виробів.
Продукція ICA призначена для промислового сегмента і особливо для тих виробників, які висувають високі вимоги до якості оздоблення. Виходячи з цих передумов, ми пропонуємо різні рішення:

Лаки, фарби та пігменти на водній основі для зовнішніх робіт;

Лаки, фарби та пігменти на поліуретановій основі для внутрішніх робіт;

Просочення (морилка) на водній основі для зовнішніх робіт;

Грунтовки, лаки та фарби на поліуретановій і акриловій основі для MDF;

Фарби для неорганічних підкладок (для скла);

Фарби зі спеціальними ефектами (металік, крекінг тощо).
